import React from 'react'
import { Table, Container } from 'reactstrap'
import NewUser from './NewUser'


export default function criaTabe(props){
    let nomes = [];
     for(let i = 0;i < props.linhas; i++){
         nomes.push(
             <tr>
                 <td>
                    <NewUser nome = "Teste"/>
                 </td>
             </tr>
         )
     }

     return(
         <div>
             {nomes}
         </div>
     )
   
}
